import "./App.css";
import NavbarAdmin from "../layouts/NavbarAdmin/NavbarAdmin";
import AddProfileForm from "../components/FormAddProfiles/AddProfileForm";
import Profiles from "../components/Profiles/Profiles";
import UpdateProfile from "../components/UpdateProfile/UpdateProfile";
import Repo from "../components/Repo/Repo";
import { BrowserRouter, Routes, Route } from "react-router-dom"

function AdminPanel() {

  return (
    <div className="AdminPanel">
      <NavbarAdmin/>
      <BrowserRouter>
      <Routes>
        <Route path='/admin/profiles' element={<Profiles/>}></Route>
        <Route path='/admin/create' element={<AddProfileForm/>}></Route>
        <Route path='/admin/update' element={<UpdateProfile />}></Route>
        <Route path='/admin/repo' element={<Repo/>}></Route>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default AdminPanel;
